import React from "react";
import "../style.css";
import { WHATS_NEW } from "../js/data";

function Newproducts() {
  return WHATS_NEW.map((product) => {
    return (
        <article className="whats-new flex">
          <div className="product-details flex">
            <div className="product-name">
              <img src="" alt="product" />
            </div>
            <div className="about-product">
              <h2 className="productName">{product.productName}</h2>
              <p className="description">{product.description}</p>
              <div className="comments-tags flex">
                <p className="comments">{product.commentCount}</p>
                <p className="tags">{product.tags}</p>
              </div>
            </div>
          </div>
          <div className="upvotes">
            <h5>{product.upvoteCount}</h5>
          </div>
        </article>
    );
  });
}

export default Newproducts;
